import {NavLink} from "react-router-dom";
import "./footer.css"
import phone from "../../src/phone-call.png"


function footer(){
    return(
      <div>
        <img src={phone} className = "icon"></img>
        <p className="phone">(519) 896-7027</p>
      </div>
    )
}

export default footer;
